import './App.css';

import { BrowserRouter as Router, Routes, Route, Redirect } from 'react-router-dom';
import Signup from './pages/Signup'; // Import your Signup component

function App() {
  return (
      <Router>
        <div className="App">
          {/* Define your routes */}
          <Routes>
            <Route path="/signup" component={Signup} />
          </Routes>

        </div>
    </Router>
  );
}

export default App;
